                // \u5982\u679c\u4e0d\u5b58\u5728\u8be5\u6587\u4ef6\u5219\u6267\u884c catch \u4e2d\u7684 next \u4ea4\u7ed9\u5176\u4ed6\u4e2d\u95f4\u4ef6\u5904\u7406\n                await access(filename);\n\n                // \u5b58\u5728\u8bbe\u7f6e\u6587\u4ef6\u7c7b\u578b\u5e76\u54cd\u5e94\u5185\u5bb9\n                ctx.set("Content-Type", "text/html;charset=utf8");\n                ctx.body = fs.createReadStream(filename);\n            }\n        } catch (e) {\n            await next();\n        }\n    }\n}\n')),(0,r.kt)("h2",{id:"\u4e09\u603b\u7ed3"},"\u4e09\u3001\u603b\u7ed3"),(0,r.kt)("p",null,"\u5728\u5b9e\u73b0\u4e2d\u95f4\u4ef6\u65f6\u5019\uff0c\u5355\u4e2a\u4e2d\u95f4\u4ef6\u5e94\u8be5\u8db3\u591f\u7b80\u5355\uff0c\u804c\u8d23\u5355\u4e00\uff0c\u4e2d\u95f4\u4ef6\u7684\u4ee3\u7801\u7f16\u5199\u5e94\u8be5\u9ad8\u6548\uff0c\u5fc5\u8981\u7684\u65f6\u5019\u901a\u8fc7\u7f13\u5b58\u91cd\u590d\u83b7\u53d6\u6570\u636e"),(0,r.kt)("p",null,(0,r.kt)("inlineCode",{parentName:"p"},"koa"),"\u672c\u8eab\u6bd4\u8f83\u7b80\u6d01\uff0c\u4f46\u662f\u901a\u8fc7\u4e2d\u95f4\u4ef6\u7684\u673a\u5236\u80fd\u591f\u5b9e\u73b0\u5404\u79cd\u6240\u9700\u8981\u7684\u529f\u80fd\uff0c\u4f7f\u5f97",(0,r.kt)("inlineCode",{parentName:"p"},"web"),"\u5e94\u7528\u5177\u5907\u826f\u597d\u7684\u53ef\u62d3\u5c55\u6027\u548c\u7ec4\u5408\u6027"),(0,r.kt)("p",null,"\u901a\u8fc7\u5c06\u516c\u5171\u903b\u8f91\u7684\u5904\u7406\u7f16\u5199\u5728\u4e2d\u95f4\u4ef6\u4e2d\uff0c\u53ef\u4ee5\u4e0d\u7528\u5728\u6bcf\u4e00\u4e2a\u63a5\u53e3\u56de\u8c03\u4e2d\u505a\u76f8\u540c\u7684\u4ee3\u7801\u7f16\u5199\uff0c\u51cf\u5c11\u4e86\u5197\u6742\u4ee3\u7801\uff0c\u8fc7\u7a0b\u5c31\u5982\u88c5\u9970\u8005\u6a21\u5f0f"),(0,r.kt)("h2",{id:"\u53c2\u8003\u6587\u732e"},"\u53c2\u8003\u6587\u732e"),(0,r.kt)("ul",null,(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("a",{parentName:"li",href:"https://segmentfault.com/a/1190000017897279"},"https://segmentfault.com/a/1190000017897279")),(0,r.kt)("li",{parentName:"ul"},(0,r.kt)("a